import './App.css';
import {Router, Switch, Route} from 'react-router-dom';
import LoginPage from './components/LoginPage';
function App() {
  return (
    <Router>
      <Switch>
        <Route path='/login' component={LoginPage}></Route>
      </Switch>
    </Router>
  );
}

export default App;
